import React from "react";

export default function currdate() {
  let date = new Date();

  return (
    <div>
      <h5>
        {date.toLocaleString("en-US", {
          weekday: "short",
          day: "numeric",
          year: "numeric",
          month: "short",
        })}
      </h5>
    </div>
  );
}
